import React from 'react';

const Navigation = ({onRouteChange, isSignedIn}) => {
	if(isSignedIn) {
		return (
			<div className='bb'>
			<nav style={{ display:'flex', justifyContent: 'flex-end'}}>
				<p onClick={() => onRouteChange('home')} className='f4 link dim black pa2 pointer'> HOME </p>
				<p onClick={() => onRouteChange('orders')} className='bl f4 link dim black pa2 pointer'> ORDERS </p>
				<p onClick={() => onRouteChange('signout')} className='bl f4 link dim black pa2 pointer'> SIGN OUT </p>
			</nav>
			</div>
		)
	}
	else {
		return (
			<div className='bb'>
			<nav style={{ display:'flex', justifyContent: 'flex-start'}} class="pa3 pa3-ns">
			  <a class="link dim black b f6 f5-ns dib mr3" href="#" title="Home">Site Name</a>
			  <a class="link dim gray    f6 f5-ns dib mr3" href="#" title="Home">Home</a>
			  <a class="link dim gray    f6 f5-ns dib mr3" href="#" title="About">About</a>
			  <a class="link dim gray    f6 f5-ns dib mr3" href="#" title="Store">Store</a>
			  <a class="link dim gray    f6 f5-ns dib" href="#" title="Contact">Contact</a>
			  <div style={{justifyContent : 'flex-end'}} onClick={() => onRouteChange('signin')} className='f4 link dim black pa2 pointer'> SIGN IN </div>
			  <div onClick={() => onRouteChange('register')} className='bl f4 link dim black pa2 pointer'> REGISTER </div>
			</nav>
			</div>
		)
	}

}

export default Navigation;
